- input: "TEXT\x1CC00418483\x1CX0\x1C\x1CF3XA\x1CThis report is amended in response
    to a letter from the Commission on February 27, 2008 requesting clarification
    as to why the 'Amended August Monthly (07/01/2007-07/31/2007), received 10/20/2007,
    Amended September Monthly (08/01/2007-08/31/2007), and October Monthly (09/01/2007-09/30/2007)
    Reports combined do not disclose any payments for salary or wages on Schedule
    B, Supporting Line 30(b) of the Detailed Summary Page.'    During this time period,
    the Committee retained the services of a single employee - an Executive Director
    - whose duties and responsibilities extend far beyond the Committee's Federal
    Election Activity. As an Independent Local Party Committee, the Committee not
    only has the option of participating in limited Federal races, but places a significant
    emphasis on building a volunteer base, community outreach, volunteer management
    of a party office, and recruitment and election of candidates from City Council
    and School Board all the way up to Nevada State Assembly and Nevada State Senate.
    \   On a monthly basis, the Executive Director completes a Payroll Log and certifies
    to the Treasurer if 'None,' '25 percent or less' or 'more than 25 percent' of
    compensated time was spent on Federal Election Activity (FEA). The employee has
    been educated as to the components of FEA.    For the months in question - and
    for every month in 2007 and thus far in 2008 - the Executive Director has submitted
    certification that '25 percent or less' of compensated time was spent on FEA.
    Based on observation of the duties and accomplishments of the Executive Director
    during the time period in question, the Treasurer has every reason to believe
    this certification is accurate.     The Committee did, in fact, compensate the
    Executive Director with 100% federal funds - as Operating Expense (Other Federal
    Operating Expenditures) reported on Line 21(b) - in most cases during this time
    period; a lack of Nonfederal funds hampered the Committee's ability to allocate
    what qualifies as Administrative Expense that could have been allocated on Lines
    21(a)(i) and 21(a)(ii).     In these amendments the Committee has clarified various
    prior references used for salaries and wages during the above-referenced periods
    to a standardized label 'Salaries and Wages' and has provided an additional memo
    on each payroll transaction to clarify that the classification as non-FEA is based
    on an employee certification in file.    There is no monetary impact based on
    these modifications.     The Committee appreciates the Commission bringing this
    matter to our attention, and will be certain to continue to allocate Salaries
    and Wages (along with associated benefit and payroll tax expense) between Federal
    and Nonfederal accounts only when it is clear and can be documented that the employee
    in question spent no more than 25% of the  compensated time on FEA.     The Committee
    is dedicated to compliance with the FEC, and to that end the Treasurer and Executive
    Director will attend and participate in the FEC Conference for Political Party
    Committees in Washington, DC in April, 2008.    NOTE: Although Total Contributions
    on Line 11(a)(iii)(A) and 11(a)(iii)(B) remain unchanged from the prior report,
    a software modification subsequent to the initial report filing apparently now
    re-classifies some contributions from unitemized to itemized based on the total
    contributions for the calendar year (some which may have been subsequent to this
    reporting period). Therefore, the data on line 11(a)(ii) shows smaller unitemized
    contributions, and the data on line 11(a)(i) shows a greater level of itemized
    contributions. The net result is a greater level of disclosure in this amended
    report, with no net change in the total reported contributions."
